import { Outlet, Link } from "react-router-dom";
import { AppBar, Toolbar, Typography, Button, Menu, MenuItem, TextField } from '@mui/material';
import React, { useState, useEffect } from 'react';


const Layout = () => {
  const [anchorEl, setAnchorEl] = useState(null);

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };
   return (
     <>
      <AppBar position="static">
          <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            Trade Activities
          </Typography>
          <Button color="inherit" onClick={handleClick}>
            Menu
          </Button>
          <Menu
            anchorEl={anchorEl}
            open={Boolean(anchorEl)}
            onClose={handleClose}
            anchorOrigin={{
              vertical: 'top',
              horizontal: 'right',
            }}
            transformOrigin={{
              vertical: 'top',
              horizontal: 'right',
            }}
          >
            <MenuItem onClick={handleClose}><Link to="/">Home</Link></MenuItem>
            <MenuItem onClick={handleClose}>Page 1</MenuItem>
            <MenuItem onClick={handleClose}>Page 2</MenuItem>
            <MenuItem onClick={handleClose}>Page 3</MenuItem>
          </Menu>
            
          </Toolbar>
        </AppBar>
       <Outlet />
     </>
   )
};

export default Layout;
